import React from 'react'
import './App.css'

class App extends React.Component {
  render() {
    return (
      <div>
        <div className="bg-menu">
            <ul>
            <a href="#" className="link home" ><i class="fas fa-home"></i></a>
            <a href="#" className="link project" ><i class="fas fa-home"></i>Projects</a>
            <a href="#" className="link beadcrumb" ><i class="far fa-angle-double-right"></i>Beadcrumb</a>
            <a href="#" className="link getting-started" ><i class="fas fa-home"></i>Getting-started</a>
            <a href="#" className="link download" ><i class="fas fa-home"></i>Download</a>
            </ul>
        </div>
      </div>
    )
  }
}

export default App
